import {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();
    this.state = {
      linuxHosts : [
        {
          ip:'143.185.140.148',
          name:'ladh1507'
        },
        {
          ip:'143.185.140.149',
          name:'ladh1508'
        },
        {
          ip:'143.185.140.150',
          name:'ladh1509'
        }

      ]
    }
  }

  render() {
    return (
      <div className="App">
        {
          this.state.linuxHosts.map((linuxHosts) => {
            return <h1>{linuxHosts.name} - {linuxHosts.ip}</h1>
          })
        }
      </div>
    );

  }
}

export default App;
